script: |
  super -f text -I q11684.spq | sort > q11684.out

inputs:
  - name: q11684.spq
    data: |
      SELECT tab1.col0 + col2 FROM tab1 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN NULL AND ( + col2 / col2 ) AND NOT col0 IN ( + col1 * - col1 );
  - name: tab1

outputs:
  - name: q11684.out
    data: |
